import Editor from "./Editor";
import {Box,styled} from"@mui/material";

// useContext
useCo

const CodeBox = styled(Box)`
    display : flex;
    background-color : #060606;
    height: 50vh;
`

const Code = () => {
    return(
        <CodeBox>
            <Editor 
                heading = "HTML"
                icon = "/"
                color= "red"
            />
            <Editor 
                heading = "CSS"
                icon = "@"
                color="blue"
            />
            <Editor 
                heading = "JS"
                icon = "{}"
                color= "yellow"
            />
        </CodeBox>
    );
}

export default Code;
